import React from 'react'
import GitHubCalendar from 'react-github-calendar';
import './Github.css'

const Github = () => {
  return (
    <div className="container">
    <GitHubCalendar username="Tusharbecoding"  style={{display: 'flex',flexDirection: 'column',position:'relative', top: '15%', width: '99%', left: '1%'}} />
    </div>
  )
}

export default Github
